('2174', '<div>\r\n<p>Wenn dein Opfer nicht wirklich starke Schmerzen haben soll, aber merken muss, dass er Dich mal Ernst zu nehmen hat, dann sind diese Boxhandschuhe PLÜSCH genau das richtige für Dich. .</p>\r\n<div>\r\n<p></p>\r\n<div>Plüschige Boxhandschuhe in trendigem rosa, weich und zärtlich.</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span> <br>\r\n</div>\r\n</div></div>', '<div><br>\r\n</div>', '', '', '', '', '', '', 'opfer,wirklich,starke,schmerzen,soll,merken,muss,dass', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2172', '<div>\r\n<p>Das ideale Trainings-Equipment für die Boxhandschuhe PLÜSCH! Mit Einschub für ein Foto, um Deinen Punch zu steigern.</p>\r\n<div>\r\n<p></p>\r\n<div>Höhe: 1,60 m.</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span> <br>\r\n</div>\r\n</div></div>', '<div><br>\r\n</div>', '', '', '', '', '', '', 'ideale,trainings-equipment,boxhandschuhe,plüsch,einschub', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('1436', '<div>\r\n<p>Die Zeiten in denen Mädchen noch so richtig brav waren sind vorbei. Die Zeiten von Kernseife auch. Heute leistet die Washlotion DIRTY GIRL auf rein pflanzlicher Basis, angereichert mit Plankton und Aloe gute Dienste nach dem Ausflug ins Nachtleben.</p>\r\n<div>\r\n<p></p>\r\n<div>Inhalt: 250 ml</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span> <br>\r\n</div>\r\n</div></div>', '<div><br>\r\n</div>', '', '', '', '', '', '', 'zeiten,denen,mädchen,richtig,brav,vorbei,zeiten', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2176', '<div>\r\n<p>Dein aufblasbarer und treuer Spielkamarad!</p>\r\n<p>MARVIN ist ferngesteuert und mit einem Walkie-Talkie ausgestattet - deshalb kann er auch sprechen.</p>\r\n<p>Maße: H 72cm, B 40cm</p>\r\n<div>\r\n<p></p>\r\n<div>Info: Batterien 4D und 1x 9V nicht im Lieferumfang enthalten.</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span> <br>\r\n</div>\r\n</div></div>', '<div><br>\r\n</div>', '', '', '', '', '', '', 'aufblasbarer,treuer,spielkamaradmarvin,ferngesteuert', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2292', '<div>\r\n<p></p>\r\n<div>Das Set beinhaltet zwei Pistolen und zwei Brustpanzer. Ziel ist es den Gegner per Infrarot-Schuss zu treffen, der Verlierer bekommt durch die Pistole einen leichten, aber harmlosen Stromschlag.</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span> <br>\r\n</div>\r\n</div>', '<div>\r\n<p>Das Set beinhaltet zwei Pistolen und zwei Brustpanzer. Ziel ist es den Gegner per Infrarot-Schuss zu treffen, der Verlierer bekommt durch die Pistole einen leichten, aber harmlosen Stromschlag.</p></div>', '', '', '', '', '', '', 'set_,beinhaltet,zwei,pistolen,zwei,brustpanzer,ziel,gegner', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2219', '<div>\r\n<p>Dieses kleine Buch ist eine "Betriebsanleitung" für Mädchen. Hunderte von Erfahrungen und Ratschlägen werden zu Ihrem Begleiter durch ein ganzes Mädchenleben ? mit Schule und Pickeln, Jungs und Sport, Geld und Autos. Bis zu dem Tag, an dem Sie sie endgültig ziehen lassen müssen...</p>\r\n<p>Vater & Tochter / Buch</p>\r\n<p>320 Seiten, zweifarbig, Broschur, Format 11 x 11 cm</p>\r\n<div>\r\n<p></p>\r\n<div>Autor: Harrison, Harry</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span> <br>\r\n</div>\r\n</div></div>', '<div><br>\r\n</div>', '', '', '', '', '', '', 'kleine,buch,betriebsanleitung,mädchen,hunderte,erfahrungen', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2196', '<div>\r\n<p>Dieses kleine Buch ist so etwas Ähnliches: Hunderte von Erfahrungen und Ratschlägen, praktisch und erprobt, aber auch humorvoll und inspirierend. Es wird sehr bald zu Ihrem unentbehrlichen Erziehungsratgeber werden...</p>\r\n<p>Vater & Sohn / Buch</p>\r\n<p>320 Seiten, zweifarbig, Broschur, Format 11 x 11 cm</p>\r\n<p>Autor: Harrison, Harry</p></div>', '<div>\r\n<p>Dieses kleine Buch ist so etwas Ähnliches: Hunderte von Erfahrungen und Ratschlägen, praktisch und erprobt, aber auch humorvoll und inspirierend. Es wird sehr bald zu Ihrem unentbehrlichen Erziehungsratgeber werden...</p>\r\n<p>&nbsp;</p>\r\n<p>Vater & Sohn / Buch</p>\r\n<p>320 Seiten, zweifarbig, Broschur, Format 11 x 11 cm</p>\r\n<p>Autor: Harrison, Harry</p></div>', '', '', '', '', '', '', 'kleine,buch,etwas,ähnliches,hunderte,erfahrungen,ratschlägen', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2162', '<div>\r\n<p></p>\r\n<div>Gängige Management-Techniken sind dem Mann von heute geläufig, den Job meistert er effizient und erfolgreich. Aber wie sieht''s in den eigenen vier Wänden aus? Endlich ist es da: das ultimative Handbuch für die Managementaufgabe No.1 - DIE HAUSARBEIT! Was bedeuten die Symbole auf den Pflegeetiketten? Wie bügele ich faltenfrei ein Hemd? Und wie bringe ich meine Wohnung schnell auf Vordermann, falls sich spontan Besuch ankündigt? Hier finden sich zahlreiche ungewöhnliche Tipps und Tricks für mehr Ordnung und Effektivität im privaten Bereich- und für die wahren Herausforderungen des modernen Alltags!</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span> <br>\r\n</div>\r\n</div>', '<div>\r\n<p>&nbsp;</p></div>', '', '', '', '', '', '', 'gängige,management-techniken,mann,heute,geläufig,job_,meistert', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2229', '<div>\r\n<p>Macht aus Deiner Hütte einen glamurösen Salon!</p>\r\n<p>Kronleuchter mit 6 Armen.</p>\r\n<p>Druchmesser: 60 cm</p>\r\n<p>Höhe: 58 cm </p>\r\n<div>\r\n<p></p>\r\n<div>Max. 25 Watt mit 6 Birnen</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span> <br>\r\n</div>\r\n</div></div>', '<div><br>\r\n</div>', '', '', '', '', '', '', 'macht,hütte,glamurösen,salonkronleuchter,armendruchmesser', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2231', '<div>\r\n<div>\r\n<p>Der absolute Hingucker im Wohnzimmer!</p>\r\n<p>Die Hängeläuchte COSMOS funktioniert mit handelsüblichen Glühbirnen (max. 10 Watt) und ist in 2 unterschiedlichen Grössen lieferbar. </p>\r\n<p>Material: Chrom</p>\r\n<p>Lieferumfang: inkl. 24 Glühbirnen</p></div>\r\n<div>\r\n<div>Variante medium:</div></div>\r\n<div>\r\n<p>Durchmesser 30 cm </p>\r\n<p>Variante large:</p>\r\n<div>Durchmesser 38 cm</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp; <br>\r\n</div></div></div>', '<br>', '', '', '', '', '', '', 'absolute,hingucker,wohnzimmerdie,hängeläuchte,cosmos,funktioniert', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2275', '<div>\r\n<p>Die Grilltonne BBQ verbreitet coole Harlem-Atmosphäre bei Deiner Grillparty.</p>\r\n<p>Farbe: pink oder hellblau</p>\r\n<p>Material: Stahl</p>\r\n<p>Lieferumfang: Grill, Grillrost, Standhilfe</p>\r\n<div>\r\n<p></p>\r\n<div>Maße: D30cm, H24cm</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp; <br>\r\n</div>\r\n</div></div>', '<br>', '', '', '', '', '', '', 'grilltonne,bbq_,verbreitet,coole,harlem-atmosphäre,grillpartyfarbe', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2026', '<div>\r\n<p>Grillkoffer ausgestattet mit 18 hochwertigen Accessoires aus Edelstahl. Der leichte, aber robuste Koffer enthält Gabel, Zange, Wender, Pinsel, Messer, 4 Grillspieße, 8 Maiskolbenhalter und eine Reinigungsbürste. Kurz, ein komplettes Set für den Profi-Griller. </p>\r\n<div>\r\n<p></p>\r\n<div>Maße: 50 x 25 x 7 cm.</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp; <br>\r\n</div>\r\n</div></div>', '<br>', '', '', '', '', '', '', 'grillkoffer,ausgestattet,hochwertigen,accessoires,edelstahl,leichte', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2347', '<div>\r\n<p>Die Lust auf das perfekte Fleisch ? El Torro, der ultimative Steaktimer! </p>\r\n<p>Männer, erobert die Küchen!</p>\r\n<p>El Torro ist der Steaktimer zum Mitgrillen. Medium, rare oder Well done? El Torro grillt Ihr Steak auf den Punkt, genau so wie Sie es am Liebsten haben! Natürlich funktioniert El Torro etwas anders als andere Küchengeräte!</p>\r\n<p>Ein Temperatursensor für die Grill- bzw. Brattemperatur misst die Temperatur der Pfanne oder des Grills. Aus dieser Außentemperatur wird über eine Differentialgleichung die Innentemperatur im Fleisch berechnet.</p>\r\n<p>Einfach Fleischdicke und Garungsart einstellen und dann ab in die Pfanne. Wenn das Fleisch den gewünschten Garungsgrad erreicht hat, spielt El Torro eine Westernmelodie.</p>\r\n<p>Ihr wollt El Torro nicht mit dem Steak in die Pfanne stellen? Kein Problem! Alternativ gibt es auch die ?intravenöse? Methode mit dem Sensorkabel. Die Nadel des Kabels einfach mittig in das Fleisch stecken. Dann die Garungsart (medium rare, medium oder well done) einstellen und los geht''s.</p>\r\n<p>El Torro kann aber nicht nur Rindersteaks auf den Punkt garen. Auch Fisch, Geflügel oder Schwein sind für El Torro kein Problem.</p>\r\n<p>Wollt Ihr das Fleisch im Backofen, auf dem offenen Grill oder auf einem Haubengrill zubereiten? Dann sollten Ihr die Methode mit dem Sensorkabel wählen, denn im Ofen und auf dem Grill ist es für El Torro zu heiß ? er soll ja beim Garen helfen und nicht gegart werden!</p>\r\n<p>Neben seinem funktionalen Nutzen ist El Torro übrigens auch ein Schmuckstück für Ihre Küche. Kühler Edelstahl gepaart mit einem goldenen oder stählernen Stier ? ein echter Hingucker!</p>\r\n<div>\r\n<p></p>\r\n<div>Praktisch ? Einfach ? Genial! El Torro, das perfekte Männergeschenk!</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.