('1351', '<div>\r\n<p>Leg sie einfach einige Stunden vor Gebrauch ins Gefrierfach und serviere deine Drinks mit 2-3 Steinen im Glas. Der riesen Vorteil: Du hast keine verwässerten Cocktails mehr.</p>\r\n<div>\r\n<p></p>\r\n<div>Inhalt: 8 Stück</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp;  <br>\r\n</div>\r\n</div></div>', '<div><br>\r\n</div>', '', '', '', '', '', '', 'leg_,einfach,stunden,gebrauch,gefrierfach,serviere,deine', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('1906', '<div>\r\n<p>Origineller Korkenzieher zum Öffnen von Weinflaschen. Funktioniert mit verblüffend wenig Kraft. <br>\r\n</p>\r\n<p>Material: Stahl, verchromt. <br>\r\n</p>\r\n<p>Abmessungen: 20,9 * 8 * 4,4 cm <br>\r\n</p>\r\n<div>\r\nGewicht: ca. 420 g</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp;  <br>\r\n</div></div>', '<div><br>\r\n</div>', '', '', '', '', '', '', 'origineller,korkenzieher,öffnen,weinflaschen,funktioniert,verblüffend', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('1477', '<div>\r\n<p>Champagnerverschluss GOLF </p>\r\n<div>\r\n<p></p>\r\n<div>Wenn du bereits einen Golfball unter dem Kopfkissen liegen hast, dann wird dich sicher auch unser Champagnerverschluss GOLF erfreuen. Er arbeitet zuverlässig nach dem ''Silberlöffelprinzip'' und ist richtig massiv gebaut.Abmessungen: 11 * 4 cm</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp;  <br>\r\n</div>\r\n</div></div>', '<br>', '', '', '', '', '', '', 'champagnerverschluss,golf,bereits,golfball,unter,kopfkissen', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('1431', '<div>\r\n<p>Nicht nur für liebliche Drinks! Du packst sie so wie sie sind ins Gefrierfach und dann ab damit ins Glas. Kein lästiges eingiessen von Wasser in irgendwelche Formen. Darüberhinaus gehören verwässerte Drinks damit der Vergangenheit an!</p>\r\n<div>\r\n<p></p>\r\n<div>Menge: 18 Stück</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp;&nbsp; <br>\r\n</div>\r\n</div></div>', '<div><br>\r\n</div>', '', '', '', '', '', '', 'liebliche,drinks,packst,gefrierfach', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('2036', '<div>\r\n<p>Material Chrome </p> \r\n<div>\r\n<p></p>\r\n<div>Höhe: 22cm, Durchmesser: 8cm</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp;  <br>\r\n</div>\r\n</div></div>', '<br>', '', '', '', '', '', '', 'material,chrome,höhe,durchmesser,8cmbezugshinweis', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('1142', '<div>\r\n<p>Das richtige Werkzeug für den Feierabend. Also die Jungs draussen auf dem Bau nehmen ja normalerweise eine zweite Flasche um die erste zu köpfen. Aber das wollen wir euch nicht wirklich antun. </p>\r\n<div>\r\n<p></p>\r\n<div>Dann sind die Heimwerker also einfach mal einen Schritt voraus.</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp;  <br>\r\n</div>\r\n</div></div>', '<br>', '', '', '', '', '', '', 'richtige,werkzeug,feierabend,jungs,draussen,bau_,nehmen', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('1131', '<div>\r\n<p></p>\r\n<div>Die Lösung nicht nur für WGs oder brüchige Partnerschaften. Du kannst sehr gut die Flasche mit dem edlen Tropfen auch vor dir selbst schützen. Einfach den Flaschenverschluss EGO drauf, die Zahlenkombination verstellen und dann schnell aus dem Kopf damit...</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp;  <br>\r\n</div>\r\n</div>', '<br>', '', '', '', '', '', '', 'lösung,wgs_,brüchige,partnerschaften,kannst,sehr,gut_', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
('1126', '<div>\r\n<div>\r\n<p>Schon viele Intellektuelle vor dir, von Hemingway bis Oscar Wild, haben sich seit dem 18. Jahrhundert von dem teuflischen Getränk um den Verstand bringen lassen. Alles für das sehr spezielle Trink-Ritual und noch einige Rezepte dazu, stecken in unserem Barset ABSINTH. All inclusive sozusagen.&nbsp;</p></div>\r\n<div>\r\n<div>Ab 18 Jahren! Inhalt:</div></div>\r\n<div>\r\n<p>2 Absinth Gläser</p>\r\n<p>1 Absinthlöffel Devil</p>\r\n<div>\r\n<p></p>\r\n<div>2 Fläschchen Absinth (je 4 cl)</div>\r\n&nbsp;\r\n<div><span style="color: #666666;"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.desaster.com/" style="color: #666666;">www.desaster.com</a> erwerben.</span>&nbsp;  <br>\r\n</div>\r\n&nbsp;\r\n&nbsp;\r\n&nbsp;</div></div></div>', '<div>\r\n<p>weiss so genau, was sich hinter den wilden Geschichten verbirgt. Schon viele Intellektuelle vor dir, von Hemingway bis Oscar Wild, haben sich seit dem 18. Jahrhundert von dem teuflischen Getränk um den Verstand bringen lassen. Alles für das sehr spezielle Trink-Ritual und noch einige Rezepte dazu, stecken in unserem Barset ABSINTH. All inclusive sozusagen. </p>\r\n<p>&nbsp;</p>\r\n<p>Ab 18 Jahren! Inhalt:</p>\r\n<p>2 Absinth Gläser</p>\r\n<p>1 Absinthlöffel Devil</p>\r\n<p>2 Fläschchen Absinth (je 4 cl)</p></div>', '', '', '', '', '', '', 'schon,viele,intellektuelle,hemingway,oscar,wild', '', '', '', '', '', '', '', '2014-05-09 13:31:42'),
