('6b6ac464656c16c90d671721c93dc6ba', '<div style="font: 12px ''Lucida Grande'', Lucida, Verdana, sans-serif">Raffiniertes Langarm-Shirt aus Pima-Baumwolle. Am Ausschnitt ist der weiche Stoff leicht gerafft und mit zwei verspielten Knöpfen versehen. Das Shirt kommt aus der exklusiven Stewart+Brown Organic Cotton Linie und verspricht die Verwendung feinster Pima-Baumwolle. Pima Baumwolle besteht aus besonders langstapeligen Fasern, die die hohe Qualität ausmachen.<br />\r\n<br /><strong>100% ökologisch angebaute Baumwolle, 100% Fair Trade.</strong><br />\r\n<br /><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href="http://www.true-fashion.com" alt="true-fashion">www.true-fashion.com</a> erwerben.</div>', '<p><span id="goog-gtc-unit-15" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">A subtle long-arm shirt of Pima cotton.&nbsp;</span></span><span id="goog-gtc-unit-16" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">The soft material is cushily nested at the cleavage and has got two frisky buttons.&nbsp;</span></span><span id="goog-gtc-unit-17" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">The shirt comes from the exclusive Stewart+Brown Organic Cotton Line and promises the usage of finest Pima cotton.&nbsp;</span></span><span id="goog-gtc-unit-18" class="goog-gtc-unit"><span dir="ltr" class="goog-gtc-translatable goog-gtc-from-human">Pima cotton consists of especially long fibres that guarantee its high quality.</span></span></p>\r\n<p><strong>100% organic cotton, 100% Fair Trade.</strong></p>\r\n<p><strong>Reference Note:</strong> if you are interested you can purchase this product at <a href="http://www.true-fashion.com" title="" target="_blank">www.true-fashion.com</a>.</p>', '', '', '', '', '', '', 'shirt,pima,langarm', 'shirt,pima,long-sleeve', '', '', '', '', '', '', '2014-05-09 13:31:42'),
