('d0cbe7b235a1c735a1f8852e3e4e3673', 'oxstartmetadescription', 2, 1, 0, 1, 1, '', 'META Description Startseite', 'Alles zum Thema Wassersport, Sportbekleidung und Mode. Umfangreiches Produktsortiment mit den neusten Trendprodukten. Blitzschneller Versand.<br />', 'META description start page', '<p>All about watersports, sportswear and fashion. Extensive product range including several trendy products. Fast shipping.</p>\r\n<p>&nbsp;</p>', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '30e44ab83fdee7564.23264141', '', '', '2014-05-09 13:33:27'),
