('e29881c739f93263f7578ebcf5e4cf1d', 'oxstartmetadescription', 5, 1, 0, 1, 1, '', 'META Description Startseite', 'Alles zum Thema Wassersport, Sportbekleidung und Mode. Umfangreiches Produktsortiment mit den neusten Trendprodukten. Blitzschneller Versand.<br />', 'META description start page', '<p>All about watersports, sportswear and fashion. Extensive product range including several trendy products. Fast shipping.</p>\r\n<p>&nbsp;</p>', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '30e44ab83fdee7564.23264141', '', '', '2014-05-09 13:34:15'),
('360e95ea1f233ab23447fd985b010a66', 'oxstartmetakeywords', 5, 1, 0, 1, 1, '', 'META Keywords Startseite', 'kite, kites, kiteboarding, kiteboards, wakeboarding, wakeboards, boards, strand, sommer, wassersport, mode, fashion, style, shirts, jeans, accessoires, angebote', 'META keywords start page', 'kite, kites, kiteboarding, kiteboards, wakeboarding, wakeboards, boards, beach, summer, watersports, funsports, fashion, style, shirts, jeans, accessories, special offers', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '30e44ab83fdee7564.23264141', '', '', '2014-05-09 13:34:15'),
('39c0a69fe3c27054c0df8e7d5e132f09', 'oxstartwelcome', 5, 1, 0, 1, 1, '', 'start.tpl Begrüßungstext', '<h1><strong>Willkommen</strong> [{ if $oxcmp_user }]<strong>[{ $oxcmp_user->oxuser__oxfname->value }] [{ $oxcmp_user->oxuser__oxlname->value }] </strong>[{else}] [{/if}][{ if !$oxcmp_user }]<strong>im OXID <span style="color: #ff3301">e</span>Shop 5</strong>[{/if}]</h1>\r\nDies ist eine Demo-Installation des <strong>OXID eShop 5</strong>. Also keine Sorge, wenn Sie bestellen: Die Ware wird weder ausgeliefert, noch in Rechnung gestellt. Die gezeigten Produkte (und Preise) dienen nur zur Veranschaulichung der umfangreichen Funktionalität des Systems.\r\n<div><strong>&nbsp;</strong></div>\r\n<div><strong>Wir wünschen viel Spaß beim Testen!</strong></div>\r\n<div><strong>Ihr OXID eSales Team</strong></div>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Hinweis für den Shop Administrator:</strong></p>\r\n<p>Dieser Text kann im Admin-Bereich unter dem Menüpunkt <em>Kundeninformation -&gt; CMS-Seiten -&gt; start.tpl Begrüßungstext</em><strong> </strong>bearbeitet werden.<strong><br />\r\n</strong></p>\r\n<p><strong>&nbsp;</strong></p>', 'start.tpl welcome text', '<h1><strong>Welcome</strong> [{ if $oxcmp_user }]<strong>[{ $oxcmp_user->oxuser__oxfname->value }] [{ $oxcmp_user->oxuser__oxlname->value }] </strong>[{else}] [{/if}][{ if !$oxcmp_user }]<strong>to OXID <span style="color: #fc6634">e</span>Shop 5</strong>[{/if}]</h1>\r\n<p>This is a demo installation of <strong>OXID eShop 5</strong>. Don''t worry when ordering: The goods will not be delivered nor charged. The displayed products and prices are solely tended to show the comprehensive functionality of the shopping cart system.</p>\r\n<div><strong>Have fun testing!</strong></div>\r\n<div><strong>Your OXID eSales team</strong></div>\r\n<p>&nbsp; </p>\r\n<p><strong>Notice for the shop administrator:</strong></p>\r\n<p>Update this text in the admin area. Choose from admin menu: <em>Customer Info -&gt; CMS Pages -&gt; start.tpl welcome text</em></p>', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '30e44ab83fdee7564.23264141', 'CMSFOLDER_USERINFO', '', '2014-05-09 13:34:15'),
('d0856c1199335261d98a5b3cbdc49610', 'oxuserorderemail', 5, 1, 0, 1, 1, '', 'Ihre Bestellung', 'Vielen Dank für Ihre Bestellung!<br>\r\n<br>\r\nNachfolgend haben wir zur Kontrolle Ihre Bestellung noch einmal aufgelistet.<br>\r\nBei Fragen sind wir jederzeit für Sie da: Schreiben Sie einfach an [{ $shop->oxshops__oxorderemail->value }]!<br>\r\n<br>', 'your order', 'Thank you for your order!<br />\r\n<br />\r\nBelow, we have listed your order.<br />\r\nIf you have any questions, don''t hesitate to drop us an e-mail [{ $shop->oxshops__oxorderemail->value }]!<br />\r\n<br />', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '30e44ab83fdee7564.23264141', 'CMSFOLDER_EMAILS', '', '2014-05-09 13:34:15'),
('a20f1370c85fd8183984ba8d618d087f', 'oxuserorderemailend', 5, 1, 0, 1, 1, '', 'Ihre Bestellung Abschluss', '<div align="left">Fügen Sie hier Ihre Widerrufsbelehrung ein.</div>', 'your order terms', '<p>Right to cancel can be inserted here.</p>', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '30e44ab83fdee7564.23264141', 'CMSFOLDER_EMAILS', '', '2014-05-09 13:34:15'),
('aee4361f67f4080024d84caea5ccab61', 'oxuserorderemailendplain', 5, 1, 0, 1, 1, '', 'Ihre Bestellung Abschluss Plain', 'Fügen Sie hier Ihre Widerrufsbelehrung ein.', 'your order terms plain', '<p>Right to cancel can be inserted here.</p>', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '30e44ab83fdee7564.23264141', 'CMSFOLDER_EMAILS', '', '2014-05-09 13:34:15'),
('56a4302af4a444404a6e22a14222ecd2', 'oxuserordernpemail', 5, 1, 0, 1, 1, '', 'Ihre Bestellung (Fremdländer)', '<div>Vielen Dank für Ihre Bestellung!</div>\r\n<p><strong><span style="color: #ff0000">Hinweis:</span></strong> Derzeit ist uns keine Versandmethode für dieses Land bekannt. Wir werden versuchen, Versandmethoden zu finden und Sie über das Ergebnis unter Angabe der Versandkosten informieren. </p>Bei Fragen sind wir jederzeit für Sie da: Schreiben Sie einfach an [{ $shop->oxshops__oxorderemail->value }]! <br />\r\n<br />', 'your order (other country)', '<p>Thank you for your order!</p>\r\n<p><strong><span style="color: #ff0000">Information:</span></strong> Currently, there is no shipping method defined for your country. We will find a method to deliver the goods you purchased and will inform you as soon as possible.</p>\r\n<p>If you have any requests, don''t hesitate to contact us! [{ $shop->oxshops__oxorderemail->value }]</p>', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '30e44ab83fdee7564.23264141', 'CMSFOLDER_EMAILS', '', '2014-05-09 13:34:15'),
('05b69b8c356bee341a54ab3c8b5a6d8d', 'oxuserordernpplainemail', 5, 1, 0, 1, 1, '', 'Ihre Bestellung (Fremdländer) Plain', 'Vielen Dank für Ihre Bestellung!\r\n\r\nHinweis: Derzeit ist uns keine Versandmethode für dieses Land bekannt. Wir werden versuchen, Versandmethoden zu finden und Sie über das Ergebnis unter Angabe der Versandkosten informieren.\r\n\r\nBei Fragen sind wir jederzeit für Sie da: Schreiben Sie einfach an [{ $shop->oxshops__oxorderemail->value }]!', 'your order plain (other country)', 'Thank you for your order!\r\nInformation: Currently, there is no shipping method defined for your country. We will find a method to deliver the goods you purchased and will inform you as soon as possible.\r\n\r\nIf you have any requests don''t hesitate to contact us! [{ $shop->oxshops__oxorderemail->value }]', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '30e44ab83fdee7564.23264141', 'CMSFOLDER_EMAILS', '', '2014-05-09 13:34:15'),
('a4ea6e2d69311de45a3566d0b7ec2fd0', 'oxuserorderplainemail', 5, 1, 0, 1, 1, '', 'Ihre Bestellung Plain', 'Vielen Dank für Ihre Bestellung!\r\n\r\nNachfolgend haben wir zur Kontrolle Ihre Bestellung noch einmal aufgelistet.\r\nBei Fragen sind wir jederzeit für Sie da: Schreiben Sie einfach an [{ $shop->oxshops__oxorderemail->value }]!', 'your order plain', 'Thank you for your order!\r\n\r\nBelow we have listed your order.\r\nIf you have any questions, don''t hesitate to drop us an e-mail [{ $shop->oxshops__oxorderemail->value }]!', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '8a142c3e4143562a5.46426637', 'CMSFOLDER_EMAILS', '', '2014-05-09 13:34:15'),
('8487df53305900f7c3eed241e1f29096', 'oxupdatepassinfoemail', 5, 1, 0, 1, 1, '', 'Ihr Passwort im eShop', 'Hallo [{ $user->oxuser__oxsal->value|oxmultilangsal }] [{ $user->oxuser__oxfname->value }] [{ $user->oxuser__oxlname->value }],\r\n<br /><br />\r\nöffnen Sie den folgenden Link, um ein neues Passwort für [{ $shop->oxshops__oxname->value }] einzurichten:\r\n<br /><br />\r\n<a href="[{ $oViewConf->getBaseDir() }]index.php?cl=forgotpwd&amp;uid=[{ $user->getUpdateId() }]&amp;lang=[{ $oViewConf->getActLanguageId() }]&amp;shp=[{ $shop->oxshops__oxid->value }]">[{ $oViewConf->getBaseDir() }]index.php?cl=forgotpwd&amp;uid=[{ $user->getUpdateId()}]&amp;lang=[{ $oViewConf->getActLanguageId() }]&amp;shp=[{ $shop->oxshops__oxid->value }]</a>\r\n<br /><br />\r\nDiesen Link können Sie innerhalb der nächsten [{ $user->getUpdateLinkTerm()/3600 }] Stunden aufrufen.\r\n<br /><br />\r\nIhr [{ $shop->oxshops__oxname->value }] Team\r\n<br />', 'password update info', 'Hello [{ $user->oxuser__oxsal->value|oxmultilangsal }] [{ $user->oxuser__oxfname->value }] [{ $user->oxuser__oxlname->value }],<br />\r\n<br />\r\nfollow this link to generate a new password for [{ $shop->oxshops__oxname->value }]:<br />\r\n<br /><a href="[{ $oViewConf->getBaseDir() }]index.php?cl=forgotpwd&amp;uid=[{ $user->getUpdateId() }]&amp;lang=[{ $oViewConf->getActLanguageId() }]&amp;shp=[{ $shop->oxshops__oxid->value }]">[{ $oViewConf->getBaseDir() }]index.php?cl=forgotpwd&amp;uid=[{ $user->getUpdateId()}]&amp;lang=[{ $oViewConf->getActLanguageId() }]&amp;shp=[{ $shop->oxshops__oxid->value }]</a><br />\r\n<br />\r\nYou can use this link within the next [{ $user->getUpdateLinkTerm()/3600 }] hours.<br />\r\n<br />\r\nYour [{ $shop->oxshops__oxname->value }] team<br />', 1, '', '', 1, 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', '8a142c3e4143562a5.46426637', 'CMSFOLDER_EMAILS', '', '2014-05-09 13:34:15');
