REPLACE INTO `oxreviews` (`OXID`, `OXACTIVE`, `OXOBJECTID`, `OXTYPE`, `OXTEXT`, `OXUSERID`, `OXCREATE`, `OXLANG`, `OXRATING`, `OXTIMESTAMP`) VALUES
('59144bf9e8fde1c26.77830717', 0, '1351', 'oxarticle', 'Endlich mal was anderes. Bis jetzt hab ich immer versucht mit Cocktailkirschen die Drinks schicker aussehen zu lassen. Doch die Idee ist auch nicht so neu. Die Nordic Rocks hingegen sind ein echter Hingucker. ... und keine Panik, das Getränk "versandety  auch nicht. Auf dass die nächste "coole" Party kommt.', '36944b76d6e583fe2.12734046', '2006-07-20 17:17:35', 0, 0, '2014-05-09 13:31:42'),
('92044c0dc2dae7f13.60198888', 0, '2041', 'oxarticle', 'Die Pantoffel sind richtig klasse! So weich und praktisch...', '92044c0db9220e842.85595739', '2006-07-21 15:52:45', 0, 0, '2014-05-09 13:31:42'),
('92044c0dc7498d770.51209637', 0, 'a7c44be4a5ddee114.67356237', 'oxarticle', 'Ein richtiger Knaller!!! Und für eine tolle Party ein MUSS!!!', '92044c0db9220e842.85595739', '2006-07-21 15:53:56', 0, 0, '2014-05-09 13:31:42'),
('59144bf9d8199c636.44695617', 0, '1651', 'oxarticle', 'Ich war positiv überrascht, wie einfach es war mein erstes eigenes Bier zu brauen. Ohne Vorkenntnisse war es kein Problem der guten Anleitung zufolgen und jeden Schritt wie beschrieben auszuführen. Freunde die zur ultimativen Bier Verköstigung eingeladen waren taten sich schwer mein Bier von den üblichen Kaufbieren zu unterscheiden. Fazit: Ich werde in Zukunft noch das ein oder andere Bier brauen und vielleicht mit unterschiedlicher Rezeptur noch bessere Ergebnisse erzielen.', 'oxdefaultadmin', '2006-07-20 17:13:05', 0, 0, '2014-05-09 13:31:42');
